              "videoId": "eIaCYI1FxAE",
              "textDisplay": "@R I don&#39;t see anyone losing their minds here. And your request is not simple, as I have already articulated. &quot;Jounalistic integrity hasn&#39;t existed since the 30s&quot; is an incredibly odd statement. You are claiming that we have lived without a reliable fourth estate for nearly 100 years? Why would you say that? Why the 30s? This is clearly nonsense. Your claim discounts all of these stories: Watergate. The lack of WMDs in Iraq. Spotlight. Weinstein. The truth about lynching in the USA. Even the current situation in Ukraine, with journalists standing against Russian oppression. You are wrong. Journalists do one of the most important jobs in the world, and I am grateful for those who are continuously committed to exposing truth. It is up to us, the consumers, to ask the right questions about the media we see and hear, to determine whether it is pushing an agenda, or if we can trust it. (See those five questions above to help draw conclusions.) \u003cbr\u003e\u003cbr\u003eAs I wrote earlier, we cannot paint the media with one big brush. There are all kinds out there, and we must be discerning. You might not ever get access to the whole McCarthy recordings because of security reasons. So the response to this situation is to verify the work of the journalists themselves. What do you know of Martin and Burns? Why do you believe they have faked the recordings? What evidence has guided you in this direction? Surely you are going off of some kind of reliable tip, not just some blanket distrust of Big Media? Because evidence of the former would be worth presenting here in this thread (please?), while the latter indicates a lack of nuance or critical thinking. \u003cbr\u003e\u003cbr\u003eAre you yourself a journalist? Is this why you are so committed to finding source material? Most of us non-journalists would not go to this trouble, as I described in my previous comment.",
              "textOriginal": "@R I don't see anyone losing their minds here. And your request is not simple, as I have already articulated. \"Jounalistic integrity hasn't existed since the 30s\" is an incredibly odd statement. You are claiming that we have lived without a reliable fourth estate for nearly 100 years? Why would you say that? Why the 30s? This is clearly nonsense. Your claim discounts all of these stories: Watergate. The lack of WMDs in Iraq. Spotlight. Weinstein. The truth about lynching in the USA. Even the current situation in Ukraine, with journalists standing against Russian oppression. You are wrong. Journalists do one of the most important jobs in the world, and I am grateful for those who are continuously committed to exposing truth. It is up to us, the consumers, to ask the right questions about the media we see and hear, to determine whether it is pushing an agenda, or if we can trust it. (See those five questions above to help draw conclusions.) \n\nAs I wrote earlier, we cannot paint the media with one big brush. There are all kinds out there, and we must be discerning. You might not ever get access to the whole McCarthy recordings because of security reasons. So the response to this situation is to verify the work of the journalists themselves. What do you know of Martin and Burns? Why do you believe they have faked the recordings? What evidence has guided you in this direction? Surely you are going off of some kind of reliable tip, not just some blanket distrust of Big Media? Because evidence of the former would be worth presenting here in this thread (please?), while the latter indicates a lack of nuance or critical thinking. \n\nAre you yourself a journalist? Is this why you are so committed to finding source material? Most of us non-journalists would not go to this trouble, as I described in my previous comment.",
