            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "eIaCYI1FxAE",
              "textDisplay": "@R No, I believe you have jumped to that conclusion. I do NOT realize that &quot;everyone on here has been disrespectful and insulting because [you] simply want to view the full audio/video.&quot; I think the reality is that people have been disrespectful because a) this is a YouTube thread and that is the norm around here, b) they have already determined that Jonathan Martin and Alexander Burns are writers worthy of their respect and they question your inability to do the same, and c) they have a sense of how the fourth estate functions in society, and they understand that they don&#39;t \u003cb\u003eneed\u003c/b\u003e to see or hear all of the raw data in order to be properly informed. \u003cbr\u003e\u003cbr\u003eIt&#39;s kind of like when you get some lab work done to potentially diagnosis a medical issue you are having. You don&#39;t need to personally parse through all of that raw data, which might involve many parameters you are unfamiliar with and would require intensive research in order to understand-- because instead, you have a doctor who can simplify that data for you, and tell you about the most important aspects of the completed lab work. You can believe the abbreviated analysis from the medical professional. \u003cbr\u003e\u003cbr\u003eOr, for an example that is even closer, and recently ripped from the headlines-- consider the leaked Supreme Court opinion written by Justice Alito. I have heard that it is over 80 pages long. Do you think I have read the entire document? No, I have not. With my schedule, that would be a luxury. Instead, I have put my faith in journalists and legal analysts to parse through it and extract the most salient points, which they then present in brief, with proper historical context for my understanding. This is a document that is currently fully available to the public, and yet I choose not to seek it out. I do not see my choice as &quot;egregious and negligent.&quot; I know that I don&#39;t need to. I&#39;m aware of how the fourth estate works. They do their jobs, so that my own precious time can be dedicated to my own work and family, and when I have time, I can absorb selected extractions from Alito&#39;s written opinion, accompanied by the journalists&#39; relevant analysis. \u003cbr\u003e\u003cbr\u003eThis is how we&#39;ve been doing it for years. This is the accepted order of things in our society. I&#39;m not implying that we should blindly believe everything. As I made clear in my previous message, we all have an obligation to be conscious, media-literate consumers, and to ask the right questions when we encounter any piece of media. But when we determine that a piece of media is reliable, there is no need for us to deep dive lengthy source documents or recordings. We can leave that to the professionals, whose job it is to break these things down for us. I have enough on my own plate, I know I don&#39;t need to be doing a journalist&#39;s job as well. \u003cbr\u003e\u003cbr\u003eI find it a bit confusing when you ask, &quot;Whose to say that watching all that, I end up agreeing with you.&quot; I&#39;m unsure what exactly it is that you would be agreeing with. That McCarthy actually said the things that he said? That is already obvious for most of us. Since the release of the recordings, McCarthy himself has had to acknowledge that he did indeed discuss resigning, and censure, and impeachment, and the 25th amendment-- all in those early days following the 6th.\u003cbr\u003e\u003cbr\u003eYou did not respond to my earlier question, asking if you have spent any time verifying the journalistic integrity of Martin and Burns. I am genuinely curious to know if you have even bothered to start doing this, since their reporting is why we have these McCarthy clips in the first place. Questioning them and their backgrounds could help you in overcoming this block you have, overcoming the barriers to your own understanding of this situation. It&#39;s possible that the full recordings might contain sensitive information related to the security of our government, and because of their principles, these journalists might \u003cb\u003enever\u003c/b\u003e be able to release the full recordings. Meanwhile, will you just live in limbo, perennially undecided, for years to come? Or will you address your trust issues as best as you can?",
              "textOriginal": "@R No, I believe you have jumped to that conclusion. I do NOT realize that \"everyone on here has been disrespectful and insulting because [you] simply want to view the full audio/video.\" I think the reality is that people have been disrespectful because a) this is a YouTube thread and that is the norm around here, b) they have already determined that Jonathan Martin and Alexander Burns are writers worthy of their respect and they question your inability to do the same, and c) they have a sense of how the fourth estate functions in society, and they understand that they don't *need* to see or hear all of the raw data in order to be properly informed. \n\nIt's kind of like when you get some lab work done to potentially diagnosis a medical issue you are having. You don't need to personally parse through all of that raw data, which might involve many parameters you are unfamiliar with and would require intensive research in order to understand-- because instead, you have a doctor who can simplify that data for you, and tell you about the most important aspects of the completed lab work. You can believe the abbreviated analysis from the medical professional. \n\nOr, for an example that is even closer, and recently ripped from the headlines-- consider the leaked Supreme Court opinion written by Justice Alito. I have heard that it is over 80 pages long. Do you think I have read the entire document? No, I have not. With my schedule, that would be a luxury. Instead, I have put my faith in journalists and legal analysts to parse through it and extract the most salient points, which they then present in brief, with proper historical context for my understanding. This is a document that is currently fully available to the public, and yet I choose not to seek it out. I do not see my choice as \"egregious and negligent.\" I know that I don't need to. I'm aware of how the fourth estate works. They do their jobs, so that my own precious time can be dedicated to my own work and family, and when I have time, I can absorb selected extractions from Alito's written opinion, accompanied by the journalists' relevant analysis. \n\nThis is how we've been doing it for years. This is the accepted order of things in our society. I'm not implying that we should blindly believe everything. As I made clear in my previous message, we all have an obligation to be conscious, media-literate consumers, and to ask the right questions when we encounter any piece of media. But when we determine that a piece of media is reliable, there is no need for us to deep dive lengthy source documents or recordings. We can leave that to the professionals, whose job it is to break these things down for us. I have enough on my own plate, I know I don't need to be doing a journalist's job as well. \n\nI find it a bit confusing when you ask, \"Whose to say that watching all that, I end up agreeing with you.\" I'm unsure what exactly it is that you would be agreeing with. That McCarthy actually said the things that he said? That is already obvious for most of us. Since the release of the recordings, McCarthy himself has had to acknowledge that he did indeed discuss resigning, and censure, and impeachment, and the 25th amendment-- all in those early days following the 6th.\n\nYou did not respond to my earlier question, asking if you have spent any time verifying the journalistic integrity of Martin and Burns. I am genuinely curious to know if you have even bothered to start doing this, since their reporting is why we have these McCarthy clips in the first place. Questioning them and their backgrounds could help you in overcoming this block you have, overcoming the barriers to your own understanding of this situation. It's possible that the full recordings might contain sensitive information related to the security of our government, and because of their principles, these journalists might *never* be able to release the full recordings. Meanwhile, will you just live in limbo, perennially undecided, for years to come? Or will you address your trust issues as best as you can?",
              "parentId": "UgxQDErRewr-Zll2TC54AaABAg",
              "authorDisplayName": "tabularasa",
              "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AGIKgqMVjnBXV6REW5_I285dK_20a820LQCqJPybPGCW=s48-c-k-c0x00ffffff-no-rj",
              "authorChannelUrl": "http://www.youtube.com/channel/UCF6vpdz8rWFeloKJmzIsyMw",
