          {
            "kind": "youtube#comment",
            "etag": "ZrHkqRIJyxcI_ROUhsxC2FCsDLE",
            "id": "UgxQDErRewr-Zll2TC54AaABAg.9aff_wpKEKw9aiEP3LN5_j",
            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "eIaCYI1FxAE",
              "textDisplay": "@R It strikes me that, in the case of your doubt-- concerning the veracity of the recordings-- one possible path forward for you, so that you might overcome your doubt (in lieu of the full recording being released), is to verify the work and established characters of journalists Jonathan Martin and Alexander Burns. \u003cbr\u003e\u003cbr\u003eHave you spent any time doing this yet? I assume your doubts are coming from a specific place. Have you addressed it? It can help when you become familiar with a writer&#39;s history, and previous contacts, and general nature. It can help you to make a more informed judgment of their ethics, and the standards they follow. \u003cbr\u003e\u003cbr\u003eWe can never paint the media with one brush, as there are many different kinds out there. There are those figures such as Hannity or Carlson, who openly state that they are entertainers, not journalists. Then there are others who present their work only after months or \u003cb\u003eyears\u003c/b\u003e of deep investigation and research, verifying everything. I think it might help us all to ask the five key questions related to media literacy, when it comes to any piece of media we encounter, anything we might see, read, or hear: \u003cbr\u003e\u003cbr\u003eWho created this message?\u003cbr\u003eWhat techniques are used to attract my attention?\u003cbr\u003eHow might people understand this message differently?\u003cbr\u003eWhat lifestyles, values and points of view are represented in, or omitted from, this message?\u003cbr\u003eWhy was this message sent?\u003cbr\u003e\u003cbr\u003eFinding out the answers to these questions can help us distinguish fact from fiction, or something legitimate from a hoax. These questions are important to dwell on, even regarding (or especially regarding) media presenters or institutions with whom we are very familiar.",
              "textOriginal": "@R It strikes me that, in the case of your doubt-- concerning the veracity of the recordings-- one possible path forward for you, so that you might overcome your doubt (in lieu of the full recording being released), is to verify the work and established characters of journalists Jonathan Martin and Alexander Burns. \n\nHave you spent any time doing this yet? I assume your doubts are coming from a specific place. Have you addressed it? It can help when you become familiar with a writer's history, and previous contacts, and general nature. It can help you to make a more informed judgment of their ethics, and the standards they follow. \n\nWe can never paint the media with one brush, as there are many different kinds out there. There are those figures such as Hannity or Carlson, who openly state that they are entertainers, not journalists. Then there are others who present their work only after months or *years* of deep investigation and research, verifying everything. I think it might help us all to ask the five key questions related to media literacy, when it comes to any piece of media we encounter, anything we might see, read, or hear: \n\nWho created this message?\nWhat techniques are used to attract my attention?\nHow might people understand this message differently?\nWhat lifestyles, values and points of view are represented in, or omitted from, this message?\nWhy was this message sent?\n\nFinding out the answers to these questions can help us distinguish fact from fiction, or something legitimate from a hoax. These questions are important to dwell on, even regarding (or especially regarding) media presenters or institutions with whom we are very familiar.",
              "parentId": "UgxQDErRewr-Zll2TC54AaABAg",
              "authorDisplayName": "tabularasa",
