              "textDisplay": "@Chubby Unicorn ~ Definitely some truth to that, although I think it&#39;s a bit more complicated.  Democrats have an inclusive and diverse big tent, which comes with strengths and weaknesses, and liberals tend to be more independent-minded, less prone to the fear-mongering and propaganda seen on the right.  Liberals are also more likely to admit mistakes and appreciate nuances, unlike the right.  Still, they need to do a better job of messaging.\u003cbr\u003e\u003cbr\u003eThen, there&#39;s the fact that Republicans are conducting asymmetrical warfare, tossing aside norms, ethics, principles, morals, truth, rule of law, honor, dignity, and decency in a blind, nihilistic quest for power.  Power to further their greed, vanity, and corruption; power to create a theocratic state; power to maintain paternalistic white supremacy; and power to please their plutocratic masters.   Which puts Democrats at a distinct disadvantage, because Republicans are willing to destroy our government and nation to get what they want, while Democrats seek to build and improve our government and nation.    \u003cbr\u003e\u003cbr\u003eAs Obama put it, &quot;They take the low road, we take the high road.&quot;  Or, as I put it here earlier, destroying democracy in order to save it is a fool&#39;s errand.  Also earlier here, I had compared the current political landscape to a minefield, which Democrats are forced to carefully negotiate.  It won&#39;t do for Democrats to adopt the sleazy tactics of Republicans, and that is not something Democratic voters would tolerate, anyway.  \u003cbr\u003e\u003cbr\u003eNonetheless, I don&#39;t know that it is fair to say that the fascist Republican cult is &quot;winning.&quot;  In fact, they are degrading and damaging the very prize they seek to win, which means that in the end everyone loses, including them.  The Republican party was already in the minority, and they are a shrinking minority.  Which explains in part the desperation evident.  I would say that if Manchin, Sinema, and Garland don&#39;t start stepping up to the plate, we could be in for some dark days ahead.  \u003cbr\u003e\u003cbr\u003eBut I also believe that the majority of Americans will always reject the dystopian, Orwellian fascist Republican world.  Any success Republicans have is likely to be only temporary and fleeting.  This fascist phase in American politics is likely to end sooner than later, just as happened with the original America First fascist movement of the 1920&#39;s and 30&#39;s.  There is hope.  But there is also plenty of work ahead for us to do.  Democracy requires constant vigilance and due diligence, and it is critical that we not allow ourselves to become complacent.",
