uld be in for some dark days ahead.  \n\nBut I also believe that the majority of Americans will always reject the dystopian, Orwellian fascist Republican world.  Any success Republicans have is likely to be only temporary and fleeting.  This fascist phase in American politics is likely to end sooner than later, just as happened with the original America First fascist movement of the 1920's and 30's.  There is hope.  But there is also plenty of work ahead for us to do.  Democracy requires constant vigilance and due diligence, and it is critical that we not allow ourselves to become complacent.",
