              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "Mmk_PjQCZco",
              "textDisplay": "🌿🖤🌿@Ichijo Festival Love your name!  Actually,  thanks for making me feel younger on this day of frustration, rage, chronic pain, of covid induced claustrophobia at day 389 of strict solitary quarantine, of cautious hope... I&#39;m 65 and showing every hard day of it. { Toddler-Wear hoodies to which is pinned a YaYa brooch made with plastic beads by my 6 year old gloriously fierce and funny grandbaby whom I have not held in nearly a year, in sweats and socks, Granny Mouse Gray Hair pulled into a clip...now my reality~Make up, hair cuts, bras, shoes, my beautiful costume jewelry found over the years of passionate second hand store treasure hunts~sucking in an unsteady breath as longing threatens to gobsmack me~suit jackets, manicures, spikey fun hair styles, lanyards to which myriad and beloved role designation tags remain affixed which I spent my life educating, working, struggling to bring to dream fruition, all tucked away, talismans of another life}. Here&#39;s the thing,  Ichijo Festival, such a joyful name, I&#39;m so damned lucky to be alive, to have this life&#39;s comforts, I&#39;m taking every opportunity to celebrate, to be amused, intrigued,  entertained. These are the ways I&#39;ve found to grace my life, to not waste the gifts I&#39;ve been given. Hell, I&#39;ve even subscribed to the laughter as therapy {it&#39;s a thing} mindfully finding comedic forums to feed the sustained laugh out loud 20 minutes every day requirement and it&#39;s working for me, antidepressant levels haven&#39;t increased in a spiraling depressing atmosphere. Best of all, Ichijo, my neighbors were first affirmed with this audio proof I&#39;m dolally, but thanks to my quick thinking daughter when called out of kindly &#39;So concerned for her, all the neighbors I&#39;ve spoken to are concerned as well&quot; now believe I&#39;ve taken a very funny lover who skate boards to see me. \u003cbr\u003eTo me, it&#39;s a mindful choice between surviving and thriving. Life&#39;s delicious moments really are just lurking about in our heads, waiting to sweep us into a human version of a puppy&#39;s Happy Dance.\u003cbr\u003eBlessing to you, Dear Ichijo.\u003cbr\u003e\u003cbr\u003ePontified by an old crone from her couch~nest, sporting perennial bedhead, a wine stained hoodie a reminder of the folly of sipping said wine before Colbert completes his comically couched political observation...",
              "textOriginal": "🌿🖤🌿@Ichijo Festival Love your name!  Actually,  thanks for making me feel younger on this day of frustration, rage, chronic pain, of covid induced claustrophobia at day 389 of strict solitary quarantine, of cautious hope... I'm 65 and showing every hard day of it. { Toddler-Wear hoodies to which is pinned a YaYa brooch made with plastic beads by my 6 year old gloriously fierce and funny grandbaby whom I have not held in nearly a year, in sweats and socks, Granny Mouse Gray Hair pulled into a clip...now my reality~Make up, hair cuts, bras, shoes, my beautiful costume jewelry found over the years of passionate second hand store treasure hunts~sucking in an unsteady breath as longing threatens to gobsmack me~suit jackets, manicures, spikey fun hair styles, lanyards to which myriad and beloved role designation tags remain affixed which I spent my life educating, working, struggling to bring to dream fruition, all tucked away, talismans of another life}. Here's the thing,  Ichijo Festival, such a joyful name, I'm so damned lucky to be alive, to have this life's comforts, I'm taking every opportunity to celebrate, to be amused, intrigued,  entertained. These are the ways I've found to grace my life, to not waste the gifts I've been given. Hell, I've even subscribed to the laughter as therapy {it's a thing} mindfully finding comedic forums to feed the sustained laugh out loud 20 minutes every day requirement and it's working for me, antidepressant levels haven't increased in a spiraling depressing atmosphere. Best of all, Ichijo, my neighbors were first affirmed with this audio proof I'm dolally, but thanks to my quick thinking daughter when called out of kindly 'So concerned for her, all the neighbors I've spoken to are concerned as well\" now believe I've taken a very funny lover who skate boards to see me. \nTo me, it's a mindful choice between surviving and thriving. Life's delicious moments really are just lurking about in our heads, waiting to sweep us into a human version of a puppy's Happy Dance.\nBlessing to you, Dear Ichijo.\n\nPontified by an old crone from her couch~nest, sporting perennial bedhead, a wine stained hoodie a reminder of the folly of sipping said wine before Colbert completes his comically couched political observation...",
