            "snippet": {
              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "hN1ui3LyFgc",
              "textDisplay": "I did not expect such a discussion. I got a few questions, like &quot;who is the ignorant one&quot;, i think it might be answered by what ignorance can be in my opinion:\u003cbr\u003eIgnorance can be ignoring facts which do not fit the own narrative.\u003cbr\u003eIgnorance can be only arguing for the sake of stating own believes.\u003cbr\u003eIgnorance can be having a discussion without the truthful attempt of finding common ground.\u003cbr\u003eIgnorance can be searching someone to blame rather than for a solution.\u003cbr\u003eIgnorance can be building a narrative merely based on pure emotions rather than on intellectual considerations.\u003cbr\u003eIgnorance can be holding on to an opinion without any adjustments although there is new information.\u003cbr\u003eIgnorance can be differentiating and assessing only by binary categories (good / bad, friend / enemy, democrat / republican, ... (this order is arbitrary))\u003cbr\u003eIgnorance can be to having lost the capability of beeing humble.\u003cbr\u003eIgnorance can be thinking someone self is not ignorant.\u003cbr\u003eI think it&#39;s nearly impossible to not be ignorant sometimes or to some extend. That&#39;s human nature, we aren&#39;t machines.\u003cbr\u003eIgnorance becomes a problem if someone is mostly unaware of being ignorant or unwilling to change.\u003cbr\u003eIgnorance can lead to division and thats not good for democracy. I think this might be what Asimov meant. \u003cbr\u003eThe americans seem to be divided to a maybe unprecedented degree, at least reagarding recent history. It should be considered a duty especially on such times to try having constructive dialogues rather than eristical ambitions. Pursuing unity to a healthy degree might be crucial for democracy.\u003cbr\u003eI wish you all the best in this troubling times, my american friends.",
              "textOriginal": "I did not expect such a discussion. I got a few questions, like \"who is the ignorant one\", i think it might be answered by what ignorance can be in my opinion:\nIgnorance can be ignoring facts which do not fit the own narrative.\nIgnorance can be only arguing for the sake of stating own believes.\nIgnorance can be having a discussion without the truthful attempt of finding common ground.\nIgnorance can be searching someone to blame rather than for a solution.\nIgnorance can be building a narrative merely based on pure emotions rather than on intellectual considerations.\nIgnorance can be holding on to an opinion without any adjustments although there is new information.\nIgnorance can be differentiating and assessing only by binary categories (good / bad, friend / enemy, democrat / republican, ... (this order is arbitrary))\nIgnorance can be to having lost the capability of beeing humble.\nIgnorance can be thinking someone self is not ignorant.\nI think it's nearly impossible to not be ignorant sometimes or to some extend. That's human nature, we aren't machines.\nIgnorance becomes a problem if someone is mostly unaware of being ignorant or unwilling to change.\nIgnorance can lead to division and thats not good for democracy. I think this might be what Asimov meant. \nThe americans seem to be divided to a maybe unprecedented degree, at least reagarding recent history. It should be considered a duty especially on such times to try having constructive dialogues rather than eristical ambitions. Pursuing unity to a healthy degree might be crucial for democracy.\nI wish you all the best in this troubling times, my american friends.",
