              "textDisplay": "@Kenny Lee Jian SiongKenny, relax, I only gave you some numbers and statistics to show you that the US is, by some parameters, not as rich as you believe, especially it&#39;s citizens, it&#39;s families. The EU is richer and it&#39;s citizens enjoy universal health care, long paid holidays, maternity and paternity leave (The US is also, with Lesotho, one of only two countries in the world that do not mandate paid maternity leave.) and numerous welfare programmes ($280 dollars every month per child to all families in Germany) So the unstressed German worker, to make just an example, is far more productive working less hours, than the one in the US. \u003cbr\u003e\u003cbr\u003eThe EU still remains a formidable economic power with out the UK, and I personally would never have voted for Jeremy Corbin and the Labour Party (which btw was ambiguous about it&#39;s policy on Brexit).There are many reasons why the UK left, but they have to do more with &quot;national sovereignty&quot;. They wanted to exit what they perceived as a restriction to their sovereignty, not the common market for it self.\u003cbr\u003e\u003cbr\u003eThere are many parameters by which one may argue the US is actually a third world country, such as mass incarceration, a crumbling infrastructure, and a terrible school system, extreme poverty and violence, low life expectancy and high child and mother&#39;s mortality, police brutality, but I will give you some more food for thought assuming, probably too optimistically, that you are capable of critical thinking:\u003cbr\u003e \u003cbr\u003eChild Poverty: The United States ranks near the bottom among developed nations in child poverty according to a new report from UNICEF. Nearly one third of U.S. children live in households with an income below $31,000.That’s 24 million U.S children living in poverty. And the share of children living in poverty has increased by two percent in the last decade. By contrast, 16 nations have shown significant decreases in their levels of child poverty. UNICEF reports that child poverty is often a leading indicator of increases in crime, income inequality, educational difficulties, and teen violence.\u003cbr\u003e\u003cbr\u003eA study last year found that in many American counties, especially in the deep South, life expectancy is lower than in Algeria, Nicaragua or Bangladesh. The U.S. is the only developed country that does not guarantee health care to its citizens; even after the Affordable Care Act, millions of poor Americans will remain uninsured because governors, mainly Republicans, have refused to expand Medicaid, which provides health insurance for low-income Americans. Although the federal government will pay for the expansion, many governors cited cost, even though the expansion would actually save money. America is unique among developed countries in that tens of thousands of poor Americans die because they lack health insurance, even while we spend more than twice as much of our GDP on healthcare than the average for the Organization for Economic Co-operation and Development (OECD), a collection of rich world countries. The U.S. has an infant mortality rate that dwarfs comparable nations, as well as the highest teenage-pregnancy rate in the developed world, largely because of the politically-motivated unavailability of contraception in many areas.\u003cbr\u003e\u003cbr\u003eSo enjoy having your tax dollars being spent in the military, although you have lost every war since world war II which the USSR won for you with its soldiers and your money.",
              "textOriginal": "@Kenny Lee Jian SiongKenny, relax, I only gave you some numbers and statistics to show you that the US is, by some parameters, not as rich as you believe, especially it's citizens, it's families. The EU is richer and it's citizens enjoy universal health care, long paid holidays, maternity and paternity leave (The US is also, with Lesotho, one of only two countries in the world that do not mandate paid maternity leave.) and numerous welfare programmes ($280 dollars every month per child to all families in Germany) So the unstressed German worker, to make just an example, is far more productive working less hours, than the one in the US. \n\nThe EU still remains a formidable economic power with out the UK, and I personally would never have voted for Jeremy Corbin and the Labour Party (which btw was ambiguous about it's policy on Brexit).There are many reasons why the UK left, but they have to do more with \"national sovereignty\". They wanted to exit what they perceived as a restriction to their sovereignty, not the common market for it self.\n\nThere are many parameters by which one may argue the US is actually a third world country, such as mass incarceration, a crumbling infrastructure, and a terrible school system, extreme poverty and violence, low life expectancy and high child and mother's mortality, police brutality, but I will give you some more food for thought assuming, probably too optimistically, that you are capable of critical thinking:\n \nChild Poverty: The United States ranks near the bottom among developed nations in child poverty according to a new report from UNICEF. Nearly one third of U.S. children live in households with an income below $31,000.That’s 24 million U.S children living in poverty. And the share of children living in poverty has increased by two percent in the last decade. By contrast, 16 nations have shown significant decreases in their levels of child poverty. UNICEF reports that child poverty is often a leading indicator of increases in crime, income inequality, educational difficulties, and teen violence.\n\nA study last year found that in many American counties, especially in the deep South, life expectancy is lower than in Algeria, Nicaragua or Bangladesh. The U.S. is the only developed country that does not guarantee health care to its citizens; even after the Affordable Care Act, millions of poor Americans will remain uninsured because governors, mainly Republicans, have refused to expand Medicaid, which provides health insurance for low-income Americans. Although the federal government will pay for the expansion, many governors cited cost, even though the expansion would actually save money. America is unique among developed countries in that tens of thousands of poor Americans die because they lack health insurance, even while we spend more than twice as much of our GDP on healthcare than the average for the Organization for Economic Co-operation and Development (OECD), a collection of rich world countries. The U.S. has an infant mortality rate that dwarfs comparable nations, as well as the highest teenage-pregnancy rate in the developed world, largely because of the politically-motivated unavailability of contraception in many areas.\n\nSo enjoy having your tax dollars being spent in the military, although you have lost every war since world war II which the USSR won for you with its soldiers and your money.",
