              "videoId": "o-RnFR6UoeQ",
              "textDisplay": "@Jude It&#39;s strange that you&#39;ve quoted the definition, but apparently have not understood it. Read it again. It states exactly what I&#39;ve been saying all along. What you appear to have gleaned from it is one of the popular misconceptions about socialism. Why that? \u003cbr\u003e\u003cbr\u003eThe definition you quoted plainly states that socialism advocates for the means of production to be publicly owned. Period. That means all of it. Nowhere does it state \u003cb\u003epartially\u003c/b\u003e publicly owned. \u003cbr\u003e\u003cbr\u003eExplaining the difference between socialism and communism is difficult because in contrast to socialism, communism really never has been clearly defined, not even by Marx. Communism also includes many properties which have nothing to do with economics. However, scholars agree that in a socialist state, people can still privately own their cars, their property and their own houses (just some examples). In a communist state such thing will be publicly owned as well (like in Cuba 20 years ago).\u003cbr\u003e\u003cbr\u003eYou seem to misunderstand these terms as referring to how much of an economy is publicly or privately owned. That is wrong. It&#39;s about how ownership is determined by default.\u003cbr\u003e\u003cbr\u003eCan anyone buy their own property? If so, it&#39;s NOT communist. \u003cbr\u003e\u003cbr\u003eCan anyone start their own business, according to a standardized set of laws and procedures, without arbitrary government interference? If so, then it&#39;s NOT socialist. It&#39;s this policy that defines a capitalist economy. As long as this is possible, it remains a capitalist economy, no matter how much a government invests into providing services itself. This is why the US is considered capitalistic, despite the pentagon, all by its lonesome, being the largest publicly funded operation in the world.\u003cbr\u003e\u003cbr\u003eNote also that by your definition, a capitalist economy (where the state renders no services whatsoever) would be a purely theoretical concept that doesn&#39;t exist in practice. That wouldn&#39;t be very useful, which is one reason why scholars don&#39;t use the term in the way you&#39;ve misunderstood it.",
              "textOriginal": "@Jude It's strange that you've quoted the definition, but apparently have not understood it. Read it again. It states exactly what I've been saying all along. What you appear to have gleaned from it is one of the popular misconceptions about socialism. Why that? \n\nThe definition you quoted plainly states that socialism advocates for the means of production to be publicly owned. Period. That means all of it. Nowhere does it state *partially* publicly owned. \n\nExplaining the difference between socialism and communism is difficult because in contrast to socialism, communism really never has been clearly defined, not even by Marx. Communism also includes many properties which have nothing to do with economics. However, scholars agree that in a socialist state, people can still privately own their cars, their property and their own houses (just some examples). In a communist state such thing will be publicly owned as well (like in Cuba 20 years ago).\n\nYou seem to misunderstand these terms as referring to how much of an economy is publicly or privately owned. That is wrong. It's about how ownership is determined by default.\n\nCan anyone buy their own property? If so, it's NOT communist. \n\nCan anyone start their own business, according to a standardized set of laws and procedures, without arbitrary government interference? If so, then it's NOT socialist. It's this policy that defines a capitalist economy. As long as this is possible, it remains a capitalist economy, no matter how much a government invests into providing services itself. This is why the US is considered capitalistic, despite the pentagon, all by its lonesome, being the largest publicly funded operation in the world.\n\nNote also that by your definition, a capitalist economy (where the state renders no services whatsoever) would be a purely theoretical concept that doesn't exist in practice. That wouldn't be very useful, which is one reason why scholars don't use the term in the way you've misunderstood it.",
